        // Add agent
        this.rvoMgr.addAgent(Math.round(Math.random() * 100), trans, 0.5, 3, 0.05); // 添加小怪
        // this.sim.addAgent([endPos.x, endPos.z]);
        // this.goals.push([endPos.x, endPos.z]);
        // this.mods.push(trans);
